  true,\n\t\"url\": null,\n\t\"notes\": \"PDFs of seismic reflection profiles 101,110,
  111 local to the West Flank FORGE site. n45 line kilometers of seismic reflection
  data are processed data collected in 2001 through the use of vibroseis trucks. The
  initial analysis and interpretation of these data was performed by Unruh et al.
  (2001). Optim processed these data by inverting the P-wave first arrivals to create
  a 2-D velocity structure. Kirchhoff images were then created for each line using
  velocity tomograms (Unruh et al., 2001). \",\n\t\"license_title\": \"Creative Commons
